The XEM web project source does not really contains anything so we will mimic what maven will do when building to create a full web project.

= Clone xwiki-platform =

xwiki-debug-eclipse is made of peaces of xwiki-platform so you need to clone it somewhere so that xwiki-debug-eclipse can find what it needs. It's recommended to clone xwiki-platform and xwiki-debug-eclipse in the same place.

{{code language="none"}}
git clone git@github.com:xwiki/xwiki-platform.git
{{/code}}

= Clone xwiki-debug-eclipse project =

Clone it from ##git@github.com:xwiki/xwiki-debug-eclipse.git## and look at the README file instructions.

{{code language="none"}}
git clone git@github.com:xwiki/xwiki-debug-eclipse.git
{{/code}}

{{warning}}
Make sure to import it as Eclipse project and not as Maven project or it could break several pre-configured properties and it contains Eclipse linked resources based folders/files.
{{/warning}}

= [OPTIONAL] Change XWIKIPLATFORM path variable =

By default xwiki-debug-eclipse find xwiki-platform repository in ##${PROJECT_LOC}/../xwiki-platform## (which mean in the same parent folder than where you cloned xwiki-debug-eclipse). If that's not true for you, you can change it by going to project Properties -> Resources -> Linked Resources.

= Add xwiki and hibernate config =

This project comes with some example configuration you need to copy/past and set as you need it to:
* src/main/webapp/WEB-INF/xwiki.cfg.default -> src/main/webapp/WEB-INF/xwiki.cfg
* src/main/webapp/WEB-INF/xwiki.properties.default -> src/main/webapp/WEB-INF/xwiki.properties
* src/main/webapp/WEB-INF/hibernate.<database>.cfg.xml.default -> src/main/webapp/WEB-INF/hibernate.cfg.xml

